import { useEffect, useState } from 'react';
import PumpsFile from './assets/pumps.json';
import { CoordinateType } from './Streets';

const usePumps = () => {
    const [ pumps ] = useState<Array<CoordinateType>>(PumpsFile);

    return pumps;
}

export default usePumps;
